  return (
    <div className="mt-3 d-flex">
      <small className="text-muted">Show : </small>
      <select className="form-select form-select-sm" style={{ width: "3rem" }}>
        <option>10</option>
        <option>25</option>
        <option>50</option>
      </select>
    </div>
  );
}
export default PageLimit;
